import Axios from "axios";
import Head from "next/head";
import Image from "next/image";
import Carousel from "../components/carousel";
import Navbar from "../components/navbar";
import { api } from "../config/urlapi";

export default function Home({ produk }) {
  return (
    <>
      <Head>
        <title>Create Next App</title>
      </Head>
      <Navbar />
      <Carousel />
      <div className="container my-5">
        <h4 className="text-center">OUR PRODUCT</h4>
        <div className="row">
          {produk.map((produk) => {
            return (
              <div className="col-md-4">
                <div className="card">
                  <Image
                    className="card-img-top"
                    src={produk.image}
                    alt={produk.image_title}
                    layout="fill"
                    width="100%"
                    height="200"
                  />
                  <div className="card-body"></div>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </>
  );
}

Home.getInitialProps = async () => {
  let produk = await Axios.get(api + "product");
  produk = produk.data.data;
  return { produk: produk };
};
